import React, { Component } from "react";

class Dashboard extends Component {
    test(e){
        alert(e)
    }
    render() {
        return (
            <div>
                <div>
                    <div className="dashBoardHeader" id="header"
                        style={{backgroundColor:'rgb(140, 205, 224)'}}
                    >
                        <h1>DASHBOARD</h1>
                    </div>
                </div>
            </div>
        );
    }
}
export default Dashboard;
